function Expenses(newProp) {
    return (
        <div>
            {newProp.expensesArray.map(
                function (expense) {
                    return (
                        <ExpenseItem
                            key={expense.id}
                            title={expense.title}
                            amount={expense.amount}
                            date={expense.date}
                        />

                    );
                }
            )}
        </div>
    );
}
export default Expenses;
